import axios from "axios";


const endpoints = {
//development: 'backchelas.herokuapp.com',
 development: 'http://localhost:8080/',
};

export const api = axios.create({
baseURL: endpoints['development'],
timeout: 20000,
 headers: { "content-Type":"text/json", }
});
